    SpanHeading: "Welcome to Zuiz Business Services",
  },
  {
    faClass: "fa-brands fa-facebook-f",
    SocLink: "https://www.facebook.com",
  },
  {
    faClass: "fa-brands fa-instagram",
    SocLink: "https://www.instagram.com",
  },
  {
    faClass: "fa-brands fa-twitter",
    SocLink: "https://twitter.com/",
  },
  {
    faClass: "fa-brands fa-linkedin-in",
    SocLink: "https://www.linkedin.com",
  },
];
export const Navdata = [
  {
    NavImg: { Navimg },
  },
];
export const Bannerdata = [
  {
    h1: "Finance",
    span: "Solutions",
    para: `That Are Specifically Tailored To meet your business requirements`,
